module.exports = "<nb-layout>\n  <nb-layout-column>\n    <ngx-header></ngx-header>\n    <section class=\"home-section\">\n      <div class=\"container-fluid\">\n        <span class=\"image-text\">Privacy</span>\n      </div>\n      <br>\n      <div class=\"container text-left mt-5\">\n        <div class=\"row\">\n          <div class=\"col-md-12\">\n            <h2 style=\"color:#127cb0\">Privacy Statement</h2>\n            <div class=\"p-text\">\n              This Privacy Statement describes how Workforce Retention collects, uses, and protects personally\n              identifiable information. Protecting personally identifiable information about you is important to us. We\n              strive to protect the personal information under our control and take certain precautions to help maintain\n              the security and integrity of that data. <br><br>\n            </div>\n          </div>\n          <div class=\"col-md-12 mt-4\">\n            <h2 style=\"color:#0f638d\">How Workforce Retention Receives Personal Information</h2>\n            <div class=\"p-text\">\n              Your current/former employer, who has taken part in administering their plans or programs, might provide\n              the information (this may come from pay offices or HR departments). The types of personal information we\n              receive may include: <br>\n              <ul class=\"my-3\">\n                <li>\n                  Contact information and other identifiers such as name, address, phone number, mobile number, email\n                  address, position title, occupational level\n                </li>\n                <li>\n                  Demographic information such as date of birth, and gender\n                </li>\n                <li>\n                  Employment information such as date of hire, resignation date, date of termination,\n                </li>\n              </ul>\n              You provide information to Workforce Retention through a questionnaire or interview. When we conduct\n              interviews we request input from you and discuss topics pertaining to your time with your employer; this\n              may include leadership, communication, operations, career, management, pay and development opportunities.\n              This information is recorded in a secure Portal.\n            </div>\n          </div>\n\n          <div class=\"col-md-12 mt-4\">\n            <h2 style=\"color:#0f638d\">How Workforce Retention may use your Personal Information</h2>\n            <div class=\"p-text\">\n              The information you provide to Workforce Retention during an exit interview is collected and stored in a\n              secure portal and may be accessed by authorised members of your employer. We have implemented various\n              security measures to help reduce the risk of unauthorised processing or disclosure of personal information\n              and accidental loss, destruction, or damage to your personal information. <br><br>\n              The information stored may be used for a number of purposes connected with our business operations, which\n              include: <br><br>\n              1. Workforce Retention will use the contact information provided by your employer in order to arrange an\n              interview or, after completion of an interview, to seek additional information related to your interview.\n              <br><br>\n              2. Your feedback may be used to produce an individual report that includes the specific information you\n              provided during your interview. This report may be identified with your name and position details. In some\n              cases, your employer may elect for a Confidential discussion in which case this will be disclosed to you\n              and the information we collect will only be used as part of aggregated data (see point 3 for more\n              information)<br><br>\n              3. Your information may be aggregated in reports that provide statistical and qualitative summaries based\n              on yours and other responses from employees who have worked with the same employer. These reports may be\n              produced and distributed to your employers; typically the Human Resources team assigned to the\n              program.<br><br>\n              We will not use your information for purposes other than described above unless we have your consent or\n              there are specified law enforcement or public health and safety reasons.\n            </div>\n          </div>\n\n          <div class=\"col-md-12 mt-4\">\n            <h2 style=\"color:#0f638d\">Our Commitment to Protecting Your Information</h2>\n            <div class=\"p-text\">\n              Our commitment to protecting personally identifiable information also means that: <br>\n              <ul class=\"my-3\">\n                <li>\n                  We will not sell your personally identifiable information to any third party; and\n                </li>\n                <li>\n                  We won't use, transfer, or disclose your personally identifiable information to anyone outside of\n                  Workforce Retention, unless authorised by you, except in connection with your current/former\n                  employer's plans and programs, as required by law or legal process, in response to law enforcement\n                  requests, and as necessary to protect the property, interests, and rights of Workforce Retention\n                  and/or your current/former employer.\n                </li>\n              </ul>\n            </div>\n          </div>\n          <div class=\"col-md-12 mt-4\">\n            <h2 style=\"color:#0f638d\">Making Corrections</h2>\n            <div class=\"p-text\">\n              Workforce Retention is committed to accurately maintaining your personally identifiable information.\n              Although we can't guarantee that your personal information will be 100% accurate at all times, we'll take\n              reasonable steps to correct personal information that is properly identified as incorrect.\n            </div>\n          </div>\n          <div class=\"col-md-12 mt-4\">\n            <h2 style=\"color:#0f638d\">Contact Information</h2>\n            <div class=\"p-text\">\n              If you have any questions about Workforce Retentions use of your personally identifiable information or\n              about this Data Privacy Statement, please send an email to: <span\n                style=\"color:#cc6600\">enquiries@workforceretention.com.au</span>\n            </div>\n          </div>\n        </div>\n      </div>\n    </section>\n  </nb-layout-column>\n</nb-layout>"

